        missing = {}

        for field in ['barcode', 'sku', 'price']:
            col = column_map.get(field)
            if col:
                # Convert to string to handle all types
                values = df[col].astype(str).str.strip()

                if field == 'price':
                    invalid = ~values.str.replace('.', '', 1).str.isnumeric()
                else:
                    invalid = values.isin(['', '.', '_'])

                missing_rows = df[invalid]

                if not missing_rows.empty:
                    label = f"Missing {field.capitalize()}s"  # e.g., Missing Prices
                    missing[label] = missing_rows

        return missing  # ‚úÖ this must be indented to be inside the function

