    def categorize_product(title):
        if pd.isna(title):
            return 'unknown'

        for category, subcategories in patterns.items():
            if isinstance(subcategories, dict):
                for subCategory, meds in subcategories.items():
                    if isinstance(meds, dict):
                        for subsubCategory, keywords in meds.items():
                            if isinstance(keywords, dict):
                                for subsubsubCategory, sub_keywords in keywords.items():
                                    pattern = '|'.join(sub_keywords)
                                    try:
                                        if re.search(pattern, title, re.IGNORECASE):
                                            return subsubsubCategory   #Most specific (Level 4)
                                    except re.error as e:
                                        print(f"Regex error in level 4: {e}")
                            else:
                                pattern = '|'.join(keywords)
                                try:
                                    if re.search(pattern, title, re.IGNORECASE):
                                        return subsubCategory   #Level 3
                                except re.error as e:
                                    print(f"Regex error in level 3: {e}")
                    else:
                        pattern = '|'.join(meds)
                        try:
                            if re.search(pattern, title, re.IGNORECASE):
                                return subCategory   #Level 2
                        except re.error as e:
                            print(f"Regex error in level 2: {e}")
            else:
                pattern = '|'.join(subcategories)
                try:
                    if re.search(pattern, title, re.IGNORECASE):
                        return category   #Level 1
                except re.error as e:
                    print(f"Regex error in level 1: {e}")

        return 'unknown'
